import React, { Component } from 'react';
import './Calendrier.css'

class Calendrier extends Component{

    constructor(props){
        super(props);
        this.state={};
    }

    render(){
        return (
            <div className="Rectangle">
                <div className="Jours">
                    <strong> Lundi </strong>
                </div>
                <div className="Jours">
                    <strong> Mardi </strong>
                </div>
                <div className="Jours">
                    <strong> Mercredi </strong>
                </div>
                <div className="Jours">
                    <strong> Jeudi </strong>
                </div>
                <div className="Jours">
                    <strong> Vendredi </strong>
                </div>
                <div className="Jours">
                    <strong> Samedi </strong>
                </div>
                <div className="Jours">
                    <strong> Dimanche </strong>
                </div>
            </div>
        )
    }
}

export default Calendrier;
